import React from "react";
import Button from "../Button";
import oneStopFlight from "../../images/onestop.png";
import TicketList from "../TicketList/TicketList";
import DirectionRoute from "../../pages/DirectionRoute";
import s from "./Tickets.module.scss";

function Tickets({
  //   id,
  logoUrl,
  marketingCarrier,
  departure,
  origin,
  durationInMinutes,
  arrival,
  destination,
  price = "",
}) {
  // console.log({response});

  return (
    <>
      {/* response?.[1]?.items?.[1].legs[0].carriers.marketing[0].logoUrl */}
      {/* <div className={s.ticketsBlock}> */}
      <div className={s.ticket}>
        {/* <div className={s.imageLogo}> */}
        {/* <img src={image} alt="air_astana" className={s.airAstanaLogo} /> */}
        {/* <p className={s.imageInnerText}> {marketingCarrier}</p>
                </div> */}
        {/* <p className={s.imageInnerText}> {response?.[1]?.items?.[1].legs[0].segments[0].marketingCarrier.name}</p> */}
        <div className={s.imageLogo}>
          <img src={logoUrl} alt="logo" className={s.airAstanaLogo} />
          <p>{marketingCarrier}</p>
        </div>
        <div className={s.departure}>
          <h2 className={s.departureTime}>{departure}</h2>
          <h6>{origin}</h6>
        </div>
        <div className={s.stops}>
          <p>{durationInMinutes}</p>
          <img src={oneStopFlight} alt="one_stop" className={s.oneStop} />
        </div>
        <div className={s.arrival}>
          <h2 className={s.arrivalTime}>{arrival}</h2>
          <h6>{destination}</h6>
        </div>
        <h6 className={s.price}>{price}</h6>
        <Button className={s.selectButtons}>Select</Button>
      </div>
      {/* </div> */}
    </>
  );
}
export default Tickets;
